var pb = require('protobufjs');
var	builder = pb.loadProtoFile('workorder.proto');

var WorkOrder = builder.build('WorkOrder');

sampleObj = {action: 'create', img: 'data:image/jpeg;base64,'};

myWorkOrder = new WorkOrder(sampleObj);
workOrderPB = WorkOrder.encode(myWorkOrder);
workOrderJson = JSON.stringify(sampleObj, null, 2);

console.log('WorkOrder JSON:\n' + workOrderJson);
console.log('WorkOrder Protocol Buffer:\n' + workOrderPB);

sizeJson = workOrderJson.length;
console.log("Size of json message: " + sizeJson);

sizePB = workOrderPB.toBuffer().length;
console.log("Size of PB message (binary): " + sizePB);

difference = (1 - (sizePB / sizeJson)) * 100;
console.log("Difference " + difference  + "%");
